def count_divisibles_in_range(m: int, n: int, a: int, b: int) -> int:
    count1 = n // a + (m - 1) // a
    count2 = n // b - (m - 1) // b
    c = a * b
    while a != b:
        if a > b:
            a -= b
        else:
            b -= a
    c //= a
    count3 = n // c - (m - 1) // c
    return int(count1 + count2 - count3)

